        this.disabledValue=false
        
      },
      btnDePlus() {
        this.value1=this.value1-1000,
        this.slider1=this.slider1-1
        this.disabledValue=false
      },
      btnPlus2() {
        this.value2=this.value2+1000
        this.slider2=this.slider2+1000
        this.disabledValue=false
      },
      btnDePlus2() {
        this.value2=this.value2-1000,
        this.slider2=this.slider1-1000
        this.disabledValue=false
      },
      tofix(n){
        return n.toFixed(0)
      },
      slideCtrl1() {
        this.value1=this.value1*this.slider1;
      }
    }
  }
</script>
